import React from 'react';
import './App.css';
import SearchConsole from './components/searchConsole/searchConsole';
import { Switch, Route } from 'react-router';
import Result from './components/result/result';
import Signin from './components/signin/signin';
import Login from './components/login/login';
import Logout from './components/logout/logout';
import Home from './components/home/home';
import { Link } from 'react-router-dom';
import axios from 'axios';

function App() {
  const isLoggedIn = axios.defaults.headers.Authorization ? true : false;
  return (
    <div>
      <header>
        <ul>
        { isLoggedIn ? <li><Link to="/">חיפוש</Link></li> : "" }
          { !isLoggedIn ? <li><Link to="/signin">הרשמה</Link></li> : "" }
          { !isLoggedIn ? <li><Link to="/login">התחברות</Link></li> : "" }
          { isLoggedIn ? <li><Link to="/logout">התנתקות</Link></li> : "" }
        </ul>
      </header>
      <main>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/signin" component={Signin} />
          <Route path="/login" component={Login} />
          <Route path="/logout" component={Logout} />
          <Route path="/search/:queryText" component={SearchConsole} />
          <Route path="/result/:resultId" component={Result} />
        </Switch>
      </main>
    </div>
  );
}

export default App;
